import React from 'react';
import Paper from "@material-ui/core/Paper";




function Question({getquestionid,id, questions, setQuestions}) {

    const qs = [...questions];
    const q = getquestionid(parseInt(id));
    console.log(q);

    const upVote = index => {
        console.log("pressed");
        const newVote = [...questions];
        newVote[index].upVote++;
        setQuestions(newVote);
    }

    return(
        <Paper>
            <h1>Title: {q.title}</h1>
            <p>Question: {q.subtitle}</p>
            <p>Category: {q.category}</p>
            <p>Upvote: {q.upVote}</p>
            <button onClick={upVote}>UpVote</button>
        </Paper>
    )
}

export default Question;
